- input: "TEXT\x1CC00161067\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    FEC letter dated Jan 7, 2011.      In reviewing past reports, HCDP noticed that
    we dropped offsets reported on line 15 of the report for April 2010.  This amendment
    adds those offsets back into Line 15, column B, YTD totals and associated summary
    totals.      That same letter requested a review of the administrative designation
    of the post-election report.  In the course of that correction, some disbursements
    were reclassified as fundraising or FEA.  The review of disbursements also identified
    a withholding tax payment that was omitted from the original report.  That is
    corrected in this report.  Many descriptions were modified to clarify and conform
    with description protocols.      HCDP did not campaign for or against any Federal
    candidates in this campaign.  All campaign activities were generic or focused
    on non-federal candidates.    Credit card transactions were split by category
    to allow direct correlation between the credit card and the items charged.    Levin
    funds show the aggregation of the funds.    HCDP carefully reviewed the disbursements
    eligible for transfer of non-federal funds in the period from Sept 1 to Nov 22.
    \ We believe that the transfers were legal and less than the maximum allowed in
    the affected periods.    The letter noted a potential corporate contribution.
    \ It was refunded on January 25, 20111.  It also noted two individuals who were
    over their individual limits.  HCDP had noticed that Mike Miller was over the
    $10000 limit and transferred his over limit contribution to our Sate account in
    December.  Wally Kronzer was contacted to determine if he would authorize a transfer
    of his over-limit contribution to our state account.  He did so and the amount
    was transferred on January 25, 2011.    HCDP believes that this is a complete
    response to the items identified in the letter.  Please contact us for additional
    information or correction if needed. 713-802-0085      The refunded event fee
    was moved to a disbursement to manage the allocation between state and federal
    accounts.      There also was one missing contribution that was reconciled with
    the bank and added for this report.\n"
